svg.script:
webMI.addOnload(function(e) {
var id = "";
var value = true;

	webMI.data.read("AGENT.OBJECTS.PDF_View.Directory_Path",function(e) {
		if(!e.value) {
			webMI.data.call("START",{},function(e) {
				webMI.data.write("AGENT.OBJECTS.PDF_View.Directory_Path",e.result+"PDFs/");
				webMI.data.write("AGENT.OBJECTS.PDF_View.FileName",e.result+"PDFs/atvise_PDF.pdf");
			});
		}
	})

});
